webpackJsonp([64251733289818],{385:function(t,e){t.exports={data:{site:{meta:{title:"n0の断片",description:"メモとか、スニペットとか",url:"https://tkmn0.github.io/scrap",author:"n0",twitter:"n0",adsense:""}},post:{id:"/Users/noguchitakuma/Desktop/workspaces/n0WorkSapace/techblog/blog/src/pages/articles/Pocket/index.md absPath of file >>> MarkdownRemark",html:'<p>こんばんは。<br>\n久しぶりのブログ更新です。</p>\n<!--more-->\n<h3>Chromeでもリーディングリストを使いたい！</h3>\n<hr>\n<p>というかなぜデフォルトでないんだ。。。</p>\n<p>調べれば速攻で出てきます。<br>\n“Pocket”<br>\n<a href="http://getpocket.com/">http://getpocket.com/</a></p>\n<p>導入方法等は、他のブログ様を参考にされたし。。。</p>\n<p>僕はgoogleアカウントで登録しました。    </p>\n<h3>導入後</h3>\n<hr>\n<p>右上のアイコンをクリックで、現在のページを登録してくれます。</p>\n<h3>ショートカット</h3>\n<hr>\n<p>クリックするのめんどくさいなぁと思いまして。</p>\n<ul>\n<li>アイコン右クリック</li>\n<li><code>新しいショートカットを記録</code>をクリック</li>\n<li>Chromeの拡張機能一覧ページに飛びます</li>\n<li>ショートカットを入力でお好みで設定</li>\n</ul>\n<p>僕は、Command + s にしました。\nよく、間違えて上記キーを押して、htmlの保存を誤爆していたのですが、\nPocketで上書きすることが出来ました。\nめでたしめでたし。 </p>',frontmatter:{layout:"post",title:"Chromeの拡張機能Pocketを使ってみる",path:"/pocket/",categories:["tool"],date:"2018/04/30"}}},pathContext:{path:"/pocket/"}}}});
